// src/core/resources.ts
function registerResources(server) {
  server.resource("aha_idea", "aha://idea/{id}", async (uri) => {
    const id = uri.pathname.split("/").pop();
    if (!id) {
      throw new Error("Invalid idea ID: ID is missing from URI");
    }
    try {
      const idea = await AhaService.getIdea(id);
      return {
        contents: [{
          uri: uri.toString(),
          text: JSON.stringify(idea, null, 2)
        }]
      };
    } catch (error40) {
      console.error(`Error retrieving idea ${id}:`, error40);
      throw error40;
    }
  });
}

